  [],\n\t\"revision_timestamp\": \"2016-02-26T22:04:06.162324\",\n\t\"name\": \"prognostics-approach-for-power-mosfet-under-thermal-stress-aging\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The prognostic technique for a power MOSFET
  presentedrnin this paper is based on accelerated aging of MOSFETrnIRF520Npbf in
  a TO-220 package. The methodology utilizesrnthermal and power cycling to accelerate
  the life of the devices.rnThe major failure mechanism for the stress conditions
  is die attachmentrndegradation, typical for discrete devices with lead freernsolder
  die attachment. It has been determined that die attachrndegradation results in an
  increase in ON-state resistancerndue to its dependence on junction temperature.
  Increasingrnresistance, thus, can be used as a precursor of failure for therndie-attach
  failure mechanism under thermal stress. A featurernbased on normalized ON-resistance
  is computed from in-siturnmeasurements of the electro-thermal response. An ExtendedrnKalman
  filter is used as a model-based prognostics techniquesrnbased on the Bayesian tracking
  framework.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
